values:
Well I really just needed a reason to show off a new userpic from the Monell Picnic sometime back in the fall (that is MistressEditor's hair making a cameo on the right side of the icon), but I do have something vexing to note!

You all know, I love Lost, the television show, right?&nbsp; Well, I was all ready to enjoy a commercial-free new episode, the first new one since November, at 10:20 or so (commercial-free thanks to DVR).&nbsp; What should I see, but that DVR is saying it is recording both Medium (another quality show)&nbsp;and Lost, but is actually only recording Medium.&nbsp; My DVR was able to tape the Lost Recap special that aired at 9pm, but no, not the ACTUAL show.&nbsp; Curse you, Comcast, for taking away free pay channels AND not letting me enjoy my favorite current show on its first night back.&nbsp; I will just have to take this to an apartment that has an internet connection and visit abc.com and watch some Lost online (you can also watch Ugly Betty, Desperate Housewives, and a show that is quickly becoming a favorite, What About Brian?).&nbsp;&nbsp;

Lazily waiting for my 4:00 participant.
